import React , {useContext} from "react";
import {BookContext} from "../contexts/BookContext"


const Navbar = () =>{
    const {books} = useContext(BookContext);
    return (
        <div>
            <h1>Hello {books.length}</h1>

        </div>
    )
}


export default Navbar;
